import React, {Component} from 'react';

class WorkSpace extends Component {

    state={height:'1000px',width:'1680px'};

    componentDidMount() {
        this.setState({height: `${window.innerHeight - 74}px`,width:`${window.innerWidth-230}px`});
        window.addEventListener('resize',()=>{
            this.setState({height:`${window.innerHeight-74}px`,width:`${window.innerWidth-230}px`});
        });
    }

    render() {
        return (
            <div style={{minWidth:'1680px',minHeight:'1000px',height:this.state.height,width:this.state.width,border:'solid 1px gray',float:'left',marginLeft:'10px',marginTop:'10px'}}>

            </div>
        );
    }
}

export default WorkSpace;
